export const Application = Object.freeze({
  APPLICATION_NAME: 'A simple React App to list books',
});

export const BooksApiPaths = Object.freeze({
  API_URL: 'http://nyx.vima.ekt.gr',
  API_PORT: '3000',
  API_ENDPOINT: 'api/books',
  API_METHOD: 'POST',
});

export const BooksList = Object.freeze({
  HEADERS: ["id", "author", "title", "year", "country" , "city", "pages"],
});
